
// Change the main logo.
var logoIntervalId = setInterval(function () {
	var logolink = document.querySelector('.topbar a.link');
	if (logolink) {
		clearInterval(logoIntervalId);

		logolink.href = 'https://www.collabratechnology.com/';
		logolink.innerHTML = '<img height="50" src="data:image/png;base64," />';
	}
}, 250);

// Add additional links.
var infoIntervalId = setInterval(function () {
	var infoDiv = document.querySelector('div.info');
	var refLnk = document.querySelector('div.info .info__extdocs');
	if (infoDiv && refLnk) {
		clearInterval(infoIntervalId);


		// Change the Contact Us link.
		var contactLnk = document.querySelector('div.info .link[href="https://www.collabratechnology.com/#contact"]');
		contactLnk.innerText = "Contact Us";


		// Add the privacy policy
		var ppDiv = document.createElement('div');
		ppDiv.classList.add('info__privacy')

		var ppLnk = document.createElement('a');
		ppLnk.target = '_blank';
		ppLnk.href = 'https://www.collabratechnology.com/privacy-policy/';
		ppLnk.rel = 'noopener noreferrer';
		ppLnk.classList.add('link');
		ppLnk.text = 'Privacy Policy';
		ppDiv.appendChild(ppLnk);

		infoDiv.insertBefore(ppDiv, refLnk);


		// Add link to the GDrive API documentation
		var docDiv = document.createElement('div');
		docDiv.classList.add('info__documentation')

		var ppLnk = document.createElement('a');
		ppLnk.target = '_blank';
		ppLnk.href = 'https://github.com/collabratech/HangfireOrchestratorPOC#readme';
		ppLnk.rel = 'noopener noreferrer';
		ppLnk.classList.add('link');
		ppLnk.text = 'API Documentation';
		docDiv.appendChild(ppLnk);

		var tosLnk = document.querySelector('div.info .info__tos');
		infoDiv.insertBefore(docDiv, tosLnk);
	}
}, 250);
